        private bool ConsultaRecibo1(string rpu)
        {
            // SICOM1.WSServicioSICOM wssicom = new SICOM1.WSServicioSICOM();
            SICOM1.TraeRecibo wssicom = new SICOM1.TraeRecibo();

            bool result = true;

            try
            {
                wssicom.Timeout = 30000; // RSA timeout in milliseconds
                //_recipt = wssicom.ConsultaRecibo(rpu);
                _recipt = wssicom.ConsultarTrama(rpu);
            }
            catch (Exception ex)
            {
                error = ex;
                result = false;
            }
            finally
            {
                wssicom.Abort();
                wssicom.Dispose();
            }

            return result;
        }
        private bool ConsultaRecibo2(string rpu)
        {
            return false;
        }
        private bool ConsultaRecibo(string rpu)
        {
            bool result;

            if (ConsultaRecibo1(rpu) || ConsultaRecibo2(rpu))
                result = true;
            else
            {
                // si todos fallan generar un mensaje de error apropiado
                // throw new Exception("WebServices no responden");
                result = false;
            }

            return result;
        }
        private bool ConsultaTabla(string rpu)
        {
            bool result = false;
            string nombre;
            string valor;

            DataTable data = Select_ResponseData(rpu);
            if (data != null && data.Rows.Count > 0)
            {
                foreach (DataColumn col in data.Columns)
                {
                    nombre = col.ColumnName;
                    valor = data.Rows[0][nombre].ToString();
                    if (_attributes.ContainsKey(nombre))
                        _attributes[nombre] = valor;
                    else
                        _attributes.Add(nombre, valor);
                }
                result = true;
            }

            return result;
        }
