        static public Dictionary<string, string> GetAttributes(string rpu)
        {
            SICOMHelper sh = new SICOMHelper();
            Dictionary<string, string> response = sh.LeeCampos(rpu);

            Insert_ResponseData(response);

            return response;
        }

        /// <summary>
        /// Lee de la tabla origen el contenido correspondiente al campo
        /// </summary>
        /// <param name="origen">Nacional o Valle de Mexico</param>
        /// <param name="campo">campo</param>
        /// <returns>El substring correspondiente al campo</returns>
        private string LeeCampo(Origen origen, Campos campo)
        {
            return _recipt.Substring(posiciones[(int)origen, (int)campo, 0] - 1
                , posiciones[(int)origen, (int)campo, 1] - posiciones[(int)origen, (int)campo, 0] + 1);
        }
        /// <summary>
        /// Lee los campos correspondientes al rpu
        /// </summary>
        /// <param name="rpu"></param>
        /// <returns></returns>
        public Dictionary<string, string> LeeCampos(string rpu)
        {
            int or;
            Campos c;

            try
            {
                _rpu = rpu;
                for (int i = 0; i < (int)Campos.TOTAL; i++)
                    _attributes[((Campos)i).ToString()] = string.Empty;

                // First check if explicit values have been seeded in the table
                if (!ConsultaTabla(rpu))
                {
                    // No no table, try other sources

                    // check for web service and debug case 1 (both require string parsing)
                    _recipt = string.Empty;
                    bool debug1 = !appstate.DebugMode.Equals("false") && tempRpus.ContainsKey(rpu);
                    if (!ConsultaRecibo(rpu) && !debug1)
                    {
                        // if no webservice and no debug case 1 then check debug case 2 otherwise send default error
                        if (!appstate.DebugMode.Equals("false") && tempRpus2.ContainsKey(rpu))
                        {
                            _attributes = tempRpus2[rpu];
                        }
                        else
                        {
                            for (int i = 0; i < (int)Campos.TOTAL; i++)
                                _attributes[((Campos)i).ToString()] = string.Empty;
                            _attributes["ComStatus"] = "W1";
                        }
                    }
                    else
                    {
                        // at this point either the web service returned _recipt, or we have debug data to simulate it
                        if (string.IsNullOrEmpty(_recipt))
                            _recipt = tempRpus[rpu][3];

                        or = Convert.ToByte(LeeCampo(Origen.SICOM, Campos.Source));

                        // RSA 2013-02-22 some Nacional zones have migrated to Valle layout
                        if ((Origen)or == Origen.SICOM)
                        {
                            // if it is Nacional, check if it belongs to a zone that requieres a Valle handling
                            string cn = LeeCampo((Origen)or, Campos.CN);
                            if (IsInZonasCFEActiva(cn))
                                or = (int)Origen.NuevoSICOM;
                        }

                        for (int i = 0; i < (int)Campos.TOTAL; i++)
                        {
                            c = (Campos)i;
                            if (i >= posiciones.GetLength(1))
                                _attributes[c.ToString()] = string.Empty;
                            else if (posiciones[or, i, 0] > 0)
                                _attributes[c.ToString()] = LeeCampo((Origen)or, c);
                            else // No aplica, metemos vacío
                                _attributes[c.ToString()] = string.Empty;
                        }

                        if (_attributes["ComStatus"].StartsWith("A"))
                        {
                            string version = "v03";
                            posV02 = _recipt.IndexOf(version, 3236) + 3;
                            // if not found try the version 2, we assume one of the two must exists
                            if (posV02 < 3)
                            {
                                version = "v02";
                                posV02 = _recipt.IndexOf(version, 3236) + 3;
                            }
                            // try and find a second tag, if found use this one
                            int pos2 = _recipt.IndexOf(version, posV02) + 3;
                            if (pos2 > 3)
                                posV02 = pos2;     // it's there use it

                            RelativosV02();

                            if ((Origen)or == Origen.SICOM)
                                ImportesSICOM();
                            else
                                _attributes[Campos.PreviousDebit.ToString()] = "0";
                                

                            _attributes[Campos.CurrentDebit.ToString()] = _attributes[Campos.CurrentBillingStatus.ToString()] == "0"
                                && _attributes[Campos.DueDate.ToString()].CompareTo(DateTime.Now.ToString("yyyyMMdd")) < 0
                                ? "1" : "0";

                            CargaConsumos();
                            LeerConsumos();

                            LeerHistorialPagos();

                            CalculaDemandaPromedio();
                        }
                    }
                }
                // else traemos los valores de la tabla
            }
            catch (Exception ex)
            {
                for (int i = 0; i < (int)Campos.TOTAL; i++)
                    _attributes[((Campos)i).ToString()] = string.Empty;
                _attributes["ComStatus"] = "W1";
            }


            return _attributes;
        }

        private void RelativosV02()
        {
            _attributes[Campos.UserStatus.ToString()] = _recipt.Substring(posV02, 2);
            _attributes[Campos.CurrentBillingStatus.ToString()] = _recipt.Substring(posV02 - 3 - 9, 1);
            _attributes[Campos.CurrentBillingDueDate.ToString()] = _recipt.Substring(posV02 - 3 - 8, 8);
        }

        private void ImportesSICOM()
        {
            long saldo;
            long pago;
            string sPago;
            char c14;

            saldo = Convert.ToInt64(_attributes[Campos.PreviousBalance.ToString()]);
            sPago = (string)_attributes[Campos.Payment.ToString()];
            c14 = sPago.ToCharArray(13, 1)[0]; // character 14
            if (_equivalencias.ContainsKey(c14))
                sPago = sPago.Replace(c14, _equivalencias[c14]);
            pago = Convert.ToInt64(sPago);

            _attributes[Campos.PreviousDebit.ToString()] = (saldo - pago).ToString();
        }

        #region Consumptions
        /// <summary>
        /// Carga los consumos en un diccionario anioMes-consumo
        /// </summary>
        private void CargaConsumos()
        {
            string[] sConsumos = new string[13];
            string bloque = (string)_attributes[Campos.ANEXO_1.ToString()];
            string sMes;
            string sAnio;
            string sConsumo;
            int ini = 0;
            int mes;
            int mesOffset = 3;
            int anioOffset = 2;
            int consumoOffset = 9;
            int totalOffset = 21;
            int todosOffset = mesOffset + anioOffset + consumoOffset + totalOffset;
            int anioMes;

            for (int i = 1; i <= 12; i++)
            {
                sMes = bloque.Substring(ini, mesOffset);
                if (_consumosMes.Keys.Contains(sMes))
                {
                    mes = _consumosMes[sMes];
                    ini += mesOffset;
                    sAnio = bloque.Substring(ini, anioOffset);
                    ini += anioOffset;
                    sConsumo = bloque.Substring(ini, consumoOffset);
                    ini += consumoOffset + totalOffset;

                    anioMes = 200000 + int.Parse(sAnio) * 100 + mes;
                    if (_consumos.ContainsKey(anioMes))
                        _consumos[anioMes] = int.Parse(sConsumo);
                    else
                        _consumos.Add(anioMes, int.Parse(sConsumo));
                    _attributes[string.Format("Fecha{0:00}", i)] = string.Format("20{0}/{1:00}/01", sAnio, mes);
                    _attributes[string.Format("Cosumo{0:00}", i)] = sConsumo;
                }
                else
                    ini += todosOffset;
            }

            // una vez procesada limpia el campo auxiliar
            _attributes[Campos.ANEXO_1.ToString()] = string.Empty;
        }

        private bool EsVerano(int mes, int[][] temporada)
        {
            return temporada[(int)Horario.Ver].Contains(mes);
        }
        private bool EsInvierno(int mes, int[][] temporada)
        {
            return !temporada[(int)Horario.Ver].Contains(mes);
        }
        private void LeerConsumos()
        {
            // Obtener el arreglo de configuración con las temporadas de invierno y verano según la regional. temporadas[PN][INV], temporadas[PN][VER]
            // Tomar el arreglo de temporadas invierno/verano correspondiente a la regional.
            int[][] temporada = _temporadas.ContainsKey(_attributes[Campos.RGN_CFE.ToString()])
                ? _temporadas[_attributes[Campos.RGN_CFE.ToString()]]
                : _temporadas["0"];

            double totalVerano = 0;
            double totalInvierno = 0;
            double totalAnual = 0;
            int lecturasVerano = 0;
            int lecturasInvierno = 0;
            int lecturasTop = _attributes[Campos.Periodof.ToString()] == "1" ? 6 : 3;
            int meses = 0;
            string startDate = _attributes[Campos.DueDate.ToString()] == "0000/00/00"
                ? _attributes[Campos.PeriodEndDate.ToString()] : _attributes[Campos.DueDate.ToString()];
            int anio = int.Parse(startDate.Substring(0, 4));
            int mes = int.Parse(startDate.Substring(4, 2));
            int step = 0;
            bool continuar = false;
            int anioMes;

            do
            {
                step++;
                continuar = false;
                anioMes = anio * 100 + mes;

                // ANUAL
                if (meses < 12)
                {
                    // si tiene medición la contamos
                    if (_consumos.ContainsKey(anioMes))
                    {
                        meses++;
                        totalAnual += _consumos[anioMes];
                    }
                    // no tiene medición este mes, pero pude arrastrar una bimestral, contar mes
                    else if (totalAnual > 0)
                        meses++;
                    continuar = true;
                }

                // Invierno
                if (EsInvierno(mes, temporada) && lecturasInvierno < lecturasTop)
                {
                    if (_consumos.ContainsKey(anioMes))
                    {
                        lecturasInvierno++;
                        totalInvierno += _consumos[anioMes];
                    }
                    continuar = true;
                }

                // Verano
                if (EsVerano(mes, temporada) && lecturasVerano < lecturasTop)
                {
                    if (_consumos.ContainsKey(anioMes))
                    {
                        lecturasVerano++;
                        totalVerano += _consumos[anioMes];
                    }
                    continuar = true;
                }

                //AQUÍ IMPRIME EL HISTORIAL DE CONSUMOS DE INVIERNO Y VERANO 

                mes--;
                if (mes < 1)
                {
                    anio--;
                    mes = 12;
                }
            } while (step < 25 && continuar);

            int mesesVerano = lecturasTop == 3 ? lecturasVerano * 2 : lecturasVerano;
            int mesesInvierno = lecturasTop == 3 ? lecturasInvierno * 2 : lecturasInvierno;

            _attributes[Campos.HighAvgConsumption.ToString()] = Math.Round(totalAnual / 12, 2).ToString();
            _attributes[Campos.AvgConsumptionSummer.ToString()] = Math.Round(totalVerano / mesesVerano, 2).ToString();
            _attributes[Campos.AvgConsumptionWinter.ToString()] = Math.Round(totalInvierno / mesesInvierno, 2).ToString();
        }
        #endregion Consumptions

        #region Payments
        /* FUNCION VALIDAR PAGOS
        * @function ValidarPagos()
        *	Valida que no existan 3 o más pagos atrasados en el último año. Recorre el arreglo pagos y busca donde el valor para el indice [venc] sea mayor a [pago]
        *		en el caso del primer indice puede ser que el valor para [pago] sea mayor, ya que refleja la fecha de facturación si no es pagado.
        */
        private string ValidarPagos()
        {
            string result = string.Empty;

            // Calcular el año hacia atrás
            int min_periodos = _attributes[Campos.Periodof.ToString()] == "1" ? 12 : 6;
            int atrasos = 0;
            int periodos = 0;

            foreach (infoPago fecha in _pagos)
            {
                periodos++;
                // TESTING
                // echo "<PRE> $index pago = ".$fecha['pago']." - venc = ".$fecha['venc'];
                // if( fecha['pago'] > fecha['venc'])
                if (fecha.pago.CompareTo(fecha.venc) > 0)
                    atrasos++;
                if (periodos >= min_periodos)
                    break;
            }
            if (atrasos >= 3)
            {
                result = "El usuario ha presentado [ " + atrasos
                    + " ] atrasos  en el pago del servicio de energía en [ "
                    + min_periodos + " ] periodos de facturación.";
            }

            return result;
        }
        private void LeerHistorialPagos()
        {
            int pos = posV02;
            int index = 0;
            pos += 2;
            string date;
            infoPago p;

            do
            {
                date = ParseDate(_recipt.Substring(pos, 8));
                if (date == "0000/00/00")
                { // La lectura no es valida			
                    // NO SE TIENE LA FECHA DE VENCIMIENTO (cambio de ruta). SE TOMA LA FECHA DE OPERACIÓN COMO FECHA DE VENCIMIENTO
                    pos += 8;
                    date = DateAddTolerance(ParseDate(_recipt.Substring(pos, 8)));
                    if (date == "1970/01/10")
                    { // No se tienen fechas validas
                        pos += 8;
                        continue;
                    }
                    pos -= 8;
                }
                if (date.Trim(new char[] { '/', ' ' }) == "") // fin de cadena
                    break;
                p.venc = DateAddTolerance(date);
                pos += 8;
                p.pago = ParseDate(_recipt.Substring(pos, 8));
                _pagos.Add(p);
                pos += 8;
                index++;
            } while (index < 24);

            for (int i = 1; i <= _pagos.Count; i++)
            {
              _attributes[string.Format("DateDue{0:00}", i)] = _pagos[_pagos.Count - i].venc;
              _attributes[string.Format("DatePayment{0:00}", i)] = _pagos[_pagos.Count - i].pago;
            }

        }

        private void CalculaDemandaPromedio()
        {
            double total = 0;
            double valor;
            int count = 0;
            Campos c;

            for (int i = (int)Campos.DEMANDAR_01; i <= (int)Campos.DEMANDAR_16; i++)
            {
                c = (Campos)i;
                if (!string.IsNullOrEmpty(_attributes[c.ToString()])
                    && double.TryParse(_attributes[c.ToString()], out valor)
                    && valor != 0)
                {
                    count++;
                    total += valor;
                }
            }
            if (count > 0)
                _attributes[Campos.DEMANDAR_AVG.ToString()] = (total / count).ToString();
            else
                _attributes[Campos.DEMANDAR_AVG.ToString()] = "0";
        }

        private string DateAddTolerance(string txt)
        {
            if (txt == "0000/00/00")
                return "";

            DateTime dt = DateTime.Parse(txt);
            dt.AddDays(10);
            return dt.ToString(@"yyyy\/MM\/dd");
        }
        private string ParseDate(string txt)
        {
            return string.Format("{0}/{1}/{2}", txt.Substring(0, 4), txt.Substring(4, 2), txt.Substring(6, 2));
        }
        #endregion Payments

        /// <summary>
        /// Add new record
        /// </summary>
        /// <param name="attributes"></param>
        /// <returns></returns>
        static private void Insert_ResponseData(Dictionary<string, string> attributes)
        {
            try
            {
                LsApplicationState ApplicationState = new LsApplicationState(HttpContext.Current.Application);
                LsDatabase Database = new LsDatabase(ApplicationState.SQLConnString);

                StringBuilder executesqlstr = new StringBuilder("INSERT INTO ResponseData (");
                StringBuilder valuessqlstr = new StringBuilder("Values (");

                foreach (string key in attributes.Keys)
                {
                    executesqlstr.Append(key);
                    executesqlstr.Append(',');

                    valuessqlstr.Append('@');
                    valuessqlstr.Append(key);
                    valuessqlstr.Append(',');
                    //System.Diagnostics.Debug.Print(key + " : " + attributes[key].Length);
                }
                executesqlstr.Append("[FechaConsulta]");
                executesqlstr.Append(')');
                valuessqlstr.Append("GetDate()");
                valuessqlstr.Append(')');
                executesqlstr.Append(valuessqlstr);

                Database.ExecuteSQLNonQuery(executesqlstr.ToString(), attributes);
            }
            catch (LsDAException ex)
            {
                throw new LsDAException(null, "SICOM INSERT: " + ex.Message, ex, true);
            }
        }

        static private DataTable Select_ResponseData(string serviceCode)
        {
            DataTable data = null;

            try
            {
                LsApplicationState ApplicationState = new LsApplicationState(HttpContext.Current.Application);
                LsDatabase Database = new LsDatabase(ApplicationState.SQLConnString);

                string executesqlstr = "SELECT top (1) convert(nvarchar,[FechaAlta], 20) FechaAlta, [CN], [ServiceCode], [Rate], [Periodof], [Name], [Address], [Zone], [RGN_CFE], [UserStatus], [StateCode], [CityCode], [DAC], [Source], [DueDate], [MinConsumptionDate], [PeriodStartDate], [PeriodEndDate], [ComStatus], [DEMANDAR_AVG], [HighAvgConsumption], [HighAnnualConsumption], [HighConsumption], [CurrentBillingStatus], [ClaveIva], [DebitNumber] FROM [ResponseData_Backup] (nolock)  WHERE ServiceCode = '" + serviceCode + "' AND DateDiff(d, FechaAlta, GetDate()) <= 30";

                try
                {
                    Database.ExecuteSQLDataTable(executesqlstr.ToString(), out data);
                }
                catch (Exception)
                {
                    Database.ExecuteSQLDataTable(executesqlstr.ToString(), out data);
                }
            }
            catch (LsDAException ex)
            {
                // if the table doesn't exists then don't throw an exception, just continue with other methods
                //throw new LsDAException(null, "ResposeData SELECT: " + ex.Message, ex, true);
            }

            return data;
        }

        static private bool IsInZonasCFEActiva(string cn)
        {
            bool result = false;

            try
            {
                LsApplicationState ApplicationState = new LsApplicationState(HttpContext.Current.Application);
                LsDatabase Database = new LsDatabase(ApplicationState.SQLConnString);

                // Compare CN position 
                string executesqlstr = "SELECT count(*) FROM [ZonasCFEActivas] (nolock) WHERE [RegionZona] = SubString('" + cn + "', 3, Len([RegionZona]))";

                object o = Database.ExecuteSQLScalar(executesqlstr.ToString());
                if ((int)o > 0)
                    result = true;
            }
            catch (LsDAException ex)
            {
                throw new LsDAException(null, "OrigenMap SELECT: " + ex.Message, ex, true);
            }

            return result;
        }
    }
